import React, {FunctionComponent} from 'react';
import Project from '../models/project';
//import FormatDate from '../helpers/format-date';
import {statut} from '../models/statut';
import  './project-card.css';


type Props = {
    project: Project
};



const projectCard: FunctionComponent<Props> = ({project}) => {
    
    var st: string = statut[project.Statut];

    return (
        <tr className="" style={{color: "white"}} >
            <td className="col m1"></td>
            <td className="col m1"></td>
            <td className="grey darken-2 m2 center border"><span className="champ">Project Number:</span> {project.ProjectNumber} </td>
            <td className="grey darken-2 m2 center border"><span className="champ">Project Leader:</span> {project.ProjectLeader} </td>
            <td className="grey darken-2 m2 center border"><span className="champ">Statut: </span> {st} </td>
            <td className="grey darken-2 m2 center border"><span className="champ">Signature Date:</span> {project.SignatureDate.toString()
                                                                                                                                                  .slice(0, 10)
                                                                                                                                                  .split('-')
                                                                                                                                                  .join("/")} </td>
            <td className="card-content col m1"></td>
        </tr>
   
    )
};

export default projectCard;
